import React from 'react';
import styled from 'styled-components';


const Register = styled.div`
margin-top: 170px;
display: flex;
flex-direction: column;
`;

export default function RegisterForm() {
    return (
        <div>
            <input type="name" />
            <input type="email" />
            <input type="text" />
        </div>
    )
}
